const fs = require("fs")
const { execSync } = require("child_process")

const deleteFileIfExists = (filePath) => {
  if (fs.existsSync(filePath)) {
    fs.unlinkSync(filePath)
  }
}

const getAudioDuration = () => {
  const audioData = execSync(
    'ffprobe -i voice.mp3 -show_entries format=duration -v quiet -of csv="p=0"'
  ).toString()
  const audioDuration = Math.ceil(parseFloat(audioData)) + 1.5
  return audioDuration
}

deleteFileIfExists("output_audio.mp3")
deleteFileIfExists("spotify.mp3")

// -------------------------------------------------------------------
// CREATING ALL THE RESOURCES FILES
// -------------------------------------------------------------------

const music_demo =
  ""
const audio_demo =
  ""

if (!fs.existsSync("music.mp3")) {
    console.log("music.mp3 not found, writing a demo music.mp3 file...")
    const decoded1 = Buffer.from(music_demo, "base64")
    fs.writeFileSync("music.mp3", decoded1)
  }

if (!fs.existsSync("voice.mp3")) {
  console.log("voice.mp3 not found, writing a demo voice.mp3 file...")
  const decoded2 = Buffer.from(audio_demo, "base64")
  fs.writeFileSync("voice.mp3", decoded2)
}

// -------------------------------------------------------------------
// CREATING THE AUDIO FILE
// -------------------------------------------------------------------

let audioCounter1 = -1
let audioDelayInMS = -1

let outputAudioSh = "ffmpeg \\\n"

const audioConfig = "music.mp3, 0\nvoice.mp3, 0.5".trim().split("\n")

audioConfig.forEach((line) => {
  const [field1, field2] = line.split(",").map((field) => field.trim())
  outputAudioSh += `-i ${field1} \\\n`
})

outputAudioSh += '-filter_complex "\\\n'

audioConfig.forEach((line) => {
  const [field1, field2] = line.split(",").map((field) => field.trim())
  audioDelayInMS = field2 * 1000
  audioCounter1++
  outputAudioSh += `[${audioCounter1}]adelay=${audioDelayInMS}|${audioDelayInMS}[a${audioCounter1}]; \\\n`
})

audioCounter1 = -1

audioConfig.forEach((line) => {
  audioCounter1++
  outputAudioSh += `[a${audioCounter1}]\\\n`
})

audioCounter1++

outputAudioSh += `amix=inputs=${audioCounter1} \\\n`
outputAudioSh += ':duration=first:dropout_transition=99999999,volume=2.1" \\\n'
outputAudioSh += "-loglevel error \\\n"
outputAudioSh += "-b:a 320k output_audio.mp3"

execSync(outputAudioSh)

execSync("ffmpeg -i output_audio.mp3 -t " + getAudioDuration() + " -loglevel error \\\n -b:a 320k spotify.mp3")

deleteFileIfExists("output_audio.mp3")
